import React, { useState, useEffect } from "react";
import styles from "./Car.module.css"
import { dbService } from "fbase";

const Carlist = ({userObj}) => {
  const [carlist, setCarlist] = useState("");
  useEffect(() => {
    dbService.collection("Car").onSnapshot((snapshot) => {
      const carlistArray = snapshot.docs.map((doc) => ({
        id: doc.id,
        ...doc.data(),
      }));
      setCarlist(carlistArray);
    });
  }, []);
  return(
    <div>
      <div className={styles.container}>
        <div className={styles.header}>        
          <h1>신고 접수 차량</h1></div>
        <div className={styles.main}>
          <div className={styles.box}>
            <ul>
              <li>
                <span className="number">1</span>
                <span className="car_number">109다 8728</span>
                <span className="type">현대 AVANTE</span>
                <span className="place">서울 송파구 올림픽로 25</span>
                <span className="time">11:56</span>
                <span className="progress1">완료</span>
              </li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Carlist;
